【使用用途】　<Br>
急な積雪や路面凍結、雨でタイヤが滑りやすいとき。<Br>
【特徴】<Br>
雪道でタイヤが滑りやすいときにスプレーするだけでスリップ防止効果！<Br>
時速30ｋｍ以下の走行で最大10ｋｍ効果が持続！<Br>
本商品一本で、普通車（2000ｃｃクラス）のタイヤ約10～15本分に使用できます。<Br>
　【使用方法】<Br>
1.タイヤ接地面の付着物を取り除いてから、均等にスプレーして下さい。<Br>
2.10分程度乾燥するのを待って、粘度を確認した後30ｋｍ以下での走行をして下さい。<Br>
3.20分程度を目安に確認し、効果が薄れてきたら再度スプレーして下さい。<Br>
【生産国】<Br>
韓国<Br>
